import { Swiper, SwiperSlide } from "swiper/react";
import { Navigation, Autoplay, Pagination } from "swiper";
import "swiper/css";
import "swiper/css/navigation";
import "swiper/css/pagination";
import "./slide-style.css";

const Slide = () => {
  return (
    <div className="h-auto relative flex flex-1 shrink-0 items-center justify-center overflow-hidden rounded-lg bg-gray-100 shadow-lg md:py-10 xl:py-28">
      <div className="h-max w-full text-center">
        <Swiper
          slidesPerView={1}
          centeredSlides={true}
          navigation={true}
          pagination={{
            clickable: true,
          }}
          autoplay={{
            delay: 2500,
            disableOnInteraction: false,
          }}
          breakpoints={{
            601: { slidesPerView: 2 },
            1025: { slidesPerView: 3 },
          }}
          loop={true}
          modules={[Navigation, Pagination, Autoplay]}
          className="h-max"
        >
          <SwiperSlide>
            <div className="text-center">
              <img src="" alt="portfolio1" />
              <p>
                aaaaaaaaaaaaaaaaaaaaaaaaaaa
                <br />
                aaaaaaaaaaaaaaaaaaaaaaaaaaa
                <br />
                aaaaaaaaaaaaaaaaaaaaaaaaaaa
                <br />
                aaaaaaaaaaaaaaaaaaaaaaaaaaa
                <br />
                aaaaaaaaaaaaaaaaaaaaaaaaaaa
                <br />
                aaaaaaaaaaaaaaaaaaaaaaaaaaa
                <br />
                aaaaaaaaaaaaaaaaaaaaaaaaaaa
                <br />
              </p>
            </div>
          </SwiperSlide>
          <SwiperSlide>Slide 2</SwiperSlide>
          <SwiperSlide>Slide 3</SwiperSlide>
          <SwiperSlide>Slide 4</SwiperSlide>
          <SwiperSlide>Slide 5</SwiperSlide>
        </Swiper>
      </div>
    </div>
  );
};
export default Slide;
